import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css'; // Import your CSS file for basic styling (optional)

const App = () => {
  return (
    <div className="App">
      <h1>Hello, World!</h1>
      <p>Welcome to the basic React index page.</p>
    </div>
  );
};

// Render the App component to the DOM
const rootElement = document.getElementById('root');
const root = ReactDOM.createRoot(rootElement);
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
